import Vue from 'vue'
import App from './App.vue'
import router from './router'

//功能:引入mint-ui组件库
//1.将mint-ui组件库中所有组件引入当前项目
import MintUI from "mint-ui"
//2.单独引入mint-ui样式文件
import "mint-ui/lib/style.css"
//3.注册
Vue.use(MintUI)
//4.
import "./meishifont/iconfont.css"

new Vue({
  router,
  render: h => h(App),  //App App.vue根组件             
}).$mount('#app')
